	(1, '\"I try to learn from the past, but I plan for the future by focusing exclusively on the present. That''s were the fun is.\"', '[{\"commentCreator\":\"uname250\",\"comment\":\"Do you update?\",\"commentDate\":\"June 8, 2016 7:57 AM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTg3NTczMQ=\"},{\"commentCreator\":\"uname250\",\"comment\":\"But How does it work?\",\"commentDate\":\"January 19, 2016 3:35 PM\",\"commentId\":\"yhdfhlhwwe632\"},{\"commentCreator\":\"uname250\",\"comment\":\"Simpson cannot be tried again for the murders because of double jeopardy. He is currently imprisoned for an armed robbery conviction and can be released as early as next year, and Shipp thinks a confession may happen after that.\",\"commentDate\":\"January 22, 2016 5;16 AM\",\"commentId\":\"yhdfhjjoed2\"},{\"commentCreator\":\"uname250\",\"comment\":\"Later on, Hana returned to Twitter to share her account of his final moments, and showed just how much of a fighting spirit he had right up until the very end. According to Hana\",\"commentDate\":\"February 4, 2016 4:28 PM\",\"commentId\":\"yhdf88aq22\"},{\"commentCreator\":\"uname250\",\"comment\":\"The African-American man singled out by Donald Trump at a recent rally says he does not back the New York businessman.\",\"commentDate\":\"May 11, 2016 11:13 PM\",\"commentId\":\"qjwfc35e632\"},{\"commentCreator\":\"uname250\",\"comment\":\"requently - to more than 5 million Twitter followers.Cuban started to seriously accumulate wealth after he sold several early web ventures, including Broadcast.com for $5.7 billion in 1999. He was number 200 on the 2015 Forbes 400 list, with a net worth of $3 billion, up from $1.8 billion in 2005.\",\"commentDate\":\"April 5, 2016 2:16 AM\",\"commentId\":\"qjwfc35e632\"}]', '3', 'uname250', '2016-06-08 07:57:00', '2015-12-20 19:43:00', '250', 'uname250', '', '', '', '6', '1', '4'),
	(4, '“I’m not sure we need half a billion dollars in funding for women’s health programs. If you took dollar for dollar, there are many extraordinarily fine organizations, community health organizations that exist, federally sponsored community health organizations to provide quality care for women on a wide variety of health issues. But abortion should not be funded by the government, any government in my mind.”', '', '1', 'Jeb Bush', '2015-12-20 21:46:00', '2015-12-20 21:46:00', '250', 'Jeb Bush', 'Politico Magazine', 'http://www.politico.com/story/2015/08/jeb-bush-womens-health-programs-government-support-121005#ixzz3nRRhmRGH', 'Conference of evangelicals in South Carolina', '2', '1', '0'),
	(5, '\"The Senate, what is it like a French work week? You get like three days where you have to show up?\"', '[{\"commentCreator\":\"uname250\",\"comment\":\"Do you update?\",\"commentDate\":\"June 8, 2016 7:57 AM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTg3NTczMQ=\"},{\"commentCreator\":\"uname250\",\"comment\":\"But How does it work?\",\"commentDate\":\"January 19, 2016 3:35 PM\",\"commentId\":\"yhdfhlhwwe632\"},{\"commentCreator\":\"uname250\",\"comment\":\"Simpson cannot be tried again for the murders because of double jeopardy. He is currently imprisoned for an armed robbery conviction and can be released as early as next year, and Shipp thinks a confession may happen after that.\",\"commentDate\":\"January 22, 2016 5;16 AM\",\"commentId\":\"yhdfhjjoed2\"},{\"commentCreator\":\"uname250\",\"comment\":\"Later on, Hana returned to Twitter to share her account of his final moments, and showed just how much of a fighting spirit he had right up until the very end. According to Hana\",\"commentDate\":\"February 4, 2016 4:28 PM\",\"commentId\":\"yhdf88aq22\"},{\"commentCreator\":\"uname250\",\"comment\":\"The African-American man singled out by Donald Trump at a recent rally says he does not back the New York businessman.\",\"commentDate\":\"May 11, 2016 11:13 PM\",\"commentId\":\"qjwfc35e632\"},{\"commentCreator\":\"uname250\",\"comment\":\"requently - to more than 5 million Twitter followers.Cuban started to seriously accumulate wealth after he sold several early web ventures, including Broadcast.com for $5.7 billion in 1999. He was number 200 on the 2015 Forbes 400 list, with a net worth of $3 billion, up from $1.8 billion in 2005.\",\"commentDate\":\"April 5, 2016 2:16 AM\",\"commentId\":\"qjwfc35e632\"}]', '1', 'Jeb Bush', '2016-01-19 15:30:00', '2015-10-29 22:19:00', '250', 'Jeb Bush', 'CNBC', 'http://www.cnbc.com/2015/10/29/jeb-bushs-french-work-comments-nonsense-ambassador.html', 'CNBC debate', '2', '2', '1'),
	(6, '“As a public leader, one’s faith should guide you. In the United States, many people think you need to keep your faith, put it in a security box, if you’re an elected official — put it in a safety deposit box until you finish your service as a public servant and then you can go get it back. I never felt that was appropriate.”', '', '1', 'Jeb Bush', '2009-08-29 22:27:00', '2009-08-29 22:27:00', '1250', 'Jeb Bush', 'Lecture', 'http://www.nytimes.com/2015/03/18/us/politics/jeb-bush-20-years-after-conversion-is-guided-by-his-catholic-faith.html?_r=1', 'Conference - THE FUTURE OF NATIONS: FEDERALISM OR DECENTRALISM?', '2', '2', '0'),
	(7, '\"They made it seem like I''m saying there are a bunch of Chinese boots on the ground, Well, everybody knows that Chinese have physical characteristics that would make them pretty easy to identify in a setting like that. Give me a break. But they just jump on. That kind of stuff is frustrating.\"', '', '4', 'Ben Carson', '2015-12-28 22:29:00', '2015-12-28 22:29:00', '1250', 'Ben Carson', 'Interview', 'https://www.washingtonpost.com/politics/ben-carson-on-the-brink-a-process-like-this-is-pretty-brutal/2015/12/27/d0c5c1bc-a9e1-11e5-9b92-dea7cd4b1a4d_story.html', 'Washington Post', '3', '0', '0'),
	(8, '\"Part of being a winner is knowing when enough is enough. Sometimes you have to give up the fight and walk away, and move on to something that''s more productive.\"', '[{\"commentCreator\":\"uname250\",\"comment\":\"Authorities have said the boy''s mother was with the child when he slipped past a fence and into the zoo''s Gorilla World exhibit.\",\"commentDate\":\"January 19, 2016 3:35 PM\",\"commentId\":\"yhdfhlhwwe632\"},{\"commentCreator\":\"uname250\",\"comment\":\"Simpson cannot be tried again for the murders because of double jeopardy. He is currently imprisoned for an armed robbery conviction and can be released as early as next year, and Shipp thinks a confession may happen after that.\",\"commentDate\":\"January 22, 2016 5;16 AM\",\"commentId\":\"yhdfhjjoed2\"}]', '3', 'Donald Trump', '2016-06-06 08:02:00', '2015-12-14 00:00:00', '', 'Donald Trump', 'Quote', 'http://www.inc.com/larry-kim/21-brilliant-quotes-from-the-donald-trump.html', 'Inc. Com', '4', '2', '3'),
	(9, '“We have to have a wall. We have to have a border. And in that wall we’re going to have a big fat door where people can come into the country, but they have to come in legally.”', '[{\"commentCreator\":\"uname250\",\"comment\":\"No. The exact opposite. My role models are the guys I grew up with in Pittsburgh and went to school with at Indiana. The money is the easy part.\",\"commentDate\":\"January 19, 2016 3:35 PM\",\"commentId\":\"yhdfhlhwwe632\"},{\"commentCreator\":\"uname250\",\"comment\":\"Video footage shows Harambe standing next to the child and dragging him through the water. The zoo has staunchly defended its decision to shoot Harambe as necessary to protect the child.\",\"commentDate\":\"January 22, 2016 5;16 AM\",\"commentId\":\"yhdfhjjoed2\"},{\"commentCreator\":\"uname250\",\"comment\":\"I also have never asked anyone for a nickel to contribute to a charity.\",\"commentDate\":\"February 4, 2016 4:28 PM\",\"commentId\":\"yhdf88aq22\"},{\"commentCreator\":\"uname250\",\"comment\":\"The African-American man singled out by Donald Trump at a recent rally says he does not back the New York businessman.\",\"commentDate\":\"May 11, 2016 11:13 PM\",\"commentId\":\"qjwfc35e632\"},{\"commentCreator\":\"uname250\",\"comment\":\"requently - to more than 5 million Twitter followers.Cuban started to seriously accumulate wealth after he sold several early web ventures, including Broadcast.com for $5.7 billion in 1999. He was number 200 on the 2015 Forbes 400 list, with a net worth of $3 billion, up from $1.8 billion in 2005.\",\"commentDate\":\"April 5, 2016 2:16 AM\",\"commentId\":\"qjwfc35e632\"}]', '3', 'Donald Trump', '2015-10-28 11:21:00', '2015-10-28 00:00:00', '', 'Donald Trump', 'CNBC', 'http://www.cnbc.com/2015/10/28/donald-trump-mexico-going-to-pay-for-wall.html', '', '4', '0', '0'),
	(10, '\"You know, if you think back to Abraham Lincoln, he was not a loud, bombastic person by any measure. Ungainly, lanky, uncouth, but very courageous and very strong. What I’ve been emphasizing on the road lately is that strength is not defined by the decibels of which you say something or by the gesticulations associated with it, but by the accomplishments of one’s life. What have you faced, and how have you faced those things?\"', '', '4', 'Ben Carson', '2015-12-28 00:00:00', '2015-12-28 00:00:00', '', 'Ben Carson', 'Interview', 'https://www.washingtonpost.com/politics/ben-carson-on-the-brink-a-process-like-this-is-pretty-brutal/2015/12/27/d0c5c1bc-a9e1-11e5-9b92-dea7cd4b1a4d_story.html', 'Washington Post', '3', '0', '0'),
	(12, 'And I guess at the end of the day, for me—you know, people talk about their extraordinary grandchildren, but I actually have one—and we’re going to do everything we can to give her opportunities…', '[{\"commentCreator\":\"uname250\",\"comment\":\"it&#39;s working now!!\",\"commentDate\":\"June 7, 2016 2:34 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDM0MzA\"},{\"commentCreator\":\"uname250\",\"comment\":\"test 999\",\"commentDate\":\"June 7, 2016 2:32 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDMyNDM\"},{\"commentCreator\":\"uname250\",\"comment\":\"GOG OG\",\"commentDate\":\"June 7, 2016 2:24 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDI0MTM\"},{\"commentCreator\":\"uname250\",\"comment\":\"But I like teh way I feel, insiiiiiiie uhuhu you got me feeling emotions\",\"commentDate\":\"June 7, 2016 2:13 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDEzNA=\"}]', '2', 'Hillary Clinton', '2016-06-07 14:34:00', '2016-01-17 00:00:00', '2', 'Hillary Clinton', 'Breitbart Magazine', 'http://www.breitbart.com/big-government/2016/01/16/hillary-clinton-attacks-bernie-sanders-adopted-grandchildren-i-actually-have-a-grandchild/', 'MSNBC', '5', '0', '5'),
	(16, '\"The U.S. has become a dumping ground for everybody else''s problems. Thank you. It''s true, and these are the best and the finest. When Mexico sends its people, they''re not sending their best. They''re not sending you. They''re not sending you. They''re sending people that have lots of problems, and they''re bringing those problems with us. They''re bringing drugs. They''re bringing crime\"', '', '3', 'Donald Trump', '2015-06-15 00:00:00', '2015-06-15 00:00:00', '3', 'Donald Trump', 'Interview', 'http://www.realclearpolitics.com/video/2015/06/16/trump_mexico_not_sending_us_their_best_criminals_drug_dealers_and_rapists_are_crossing_border.html', 'Real Clear Politics', '0', '0', '0'),
	(17, '\"Race relations problems are almost at an all-time worst,\" he said. \"And President Obama -- I really thought he''d be a unifier. But I thought one thing he''d be is a unifier certainly between African-American and white, and I will tell you that''s turned out not to be so. He has not been a unifier. He''s been a divider.\"', '', '3', 'Donald Trump', '2015-08-15 00:00:00', '2015-08-15 00:00:00', '3', 'Donald Trump', 'Interview', 'http://www.cnn.com/2015/08/27/politics/donald-trump-african-american-polls/', 'CNN', '0', '0', '0'),
	(19, '\"America needs more new workers to help pay for retirees--\"to rebuild the demographic pyramid\" as he put it. \"Immigrants are more fertile,\" Bush said. \"And they love families and they have more intact families, and they bring a younger population. Immigrants create an engine of economic prosperity.\"', '', '1', 'Jeb Bush', '2013-06-13 00:00:00', '2013-06-13 00:00:00', '1', 'Jeb Bush', 'Conference', 'http://www.ontheissues.org/Archive/2016_Hopefuls_Jeb_Bush.htm', 'Faith and Freedom Coalition Conference', '0', '0', '0'),
	(20, '\"Too often, these are called women’s issues. Well, I am a proud lifelong fighter for women’s issues, because I firmly believe what’s good for women is good for America. … As far as I’m concerned, any issue that affects women’s lives and futures is a women’s issue.\"', '[{\"commentCreator\":\"uname1002\",\"comment\":\"Dats cause thast what they are. They are womans isue splainand simple\",\"commentDate\":\"August 21, 2016 10:35 AM\",\"commentId\":\"dW5hbWUxMDAyMjAxNjcyMTEwMzUyNQ=\"}]', '2', 'Hillary Clinton', '2016-08-21 10:35:00', '2015-09-05 00:00:00', '2', 'Hillary Clinton', 'Lecture', 'https://www.hillaryclinton.com/issues/womens-rights-and-opportunity/', 'https://www.hillaryclinton.com/', '0', '1', '1'),
	(21, '\"Laws have to be backed up with resources and political will,” she explained. “And deep-seated cultural codes, religious beliefs and structural biases have to be changed. As I have said and as I believe, the advancement of the full participation of women and girls in every aspect of their societies is the great unfinished business of the 21st century and not just for women but for everyone — and not just in far away countries but right here in the United States.\"', '[{\"commentCreator\":\"uname250\",\"comment\":\"Up with Bwernie! Down with Hillary!\",\"commentDate\":\"June 7, 2016 2:36 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDM2MzU\"},{\"commentCreator\":\"uname250\",\"comment\":\"test10000 g df zdf hzfd\",\"commentDate\":\"June 7, 2016 2:33 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDMzNTc\"},{\"commentCreator\":\"uname250\",\"comment\":\"great!\",\"commentDate\":\"June 7, 2016 2:30 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDMwMzA\"},{\"commentCreator\":\"uname250\",\"comment\":\"let&#39;s go let&#39;s go!  Heyeeeeee!!\",\"commentDate\":\"June 7, 2016 2:28 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDI4OA=\"},{\"commentCreator\":\"uname250\",\"comment\":\"bernie sanders thats who\",\"commentDate\":\"June 7, 2016 2:06 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDY0MA=\"},{\"commentCreator\":\"uname250\",\"comment\":\"willis\",\"commentDate\":\"June 7, 2016 2:05 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDUzNA=\"},{\"commentCreator\":\"uname250\",\"comment\":\"tiko\",\"commentDate\":\"June 7, 2016 2:02 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDI1OQ=\"},{\"commentCreator\":\"uname250\",\"comment\":\"how bout now chillins\",\"commentDate\":\"June 7, 2016 2:00 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDA1Nw=\"},{\"commentCreator\":\"uname250\",\"comment\":\"Ill tell you wehy?? sklghlzsdfh &#13;fg xfgxcgh dcgj 76idt yjx\",\"commentDate\":\"June 7, 2016 1:51 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxMzUxNTc\"},{\"commentCreator\":\"uname250\",\"comment\":\"why man\",\"commentDate\":\"June 7, 2016 1:50 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxMzUwNw=\"}]', '2', 'Hillary Clinton', '2016-06-07 14:36:00', '2015-08-27 00:00:00', '2', 'Hillary Clinton', 'Lecture', 'http://www.theblaze.com/blog/2015/04/27/hillary-clinton-says-religious-beliefs-have-to-be-changed-on-abortion-heres-why-thats-ironic/', '6th annual Women in the World Summit', '0', '0', '10'),
	(22, '\"We must deal with reality and stop trying to fool the people, because these budgetary issues are a big problem for all of us and for our progeny. We need to relearn the meaning of the word “sacrifice,” which is often necessary before true prosperity is realized.\"', '[{\"commentCreator\":\"uname250\",\"comment\":\"Up with Bwernie! Down with Hillary!\",\"commentDate\":\"June 7, 2016 2:36 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDM2MzU\"},{\"commentCreator\":\"uname250\",\"comment\":\"test10000 g df zdf hzfd\",\"commentDate\":\"June 7, 2016 2:33 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDMzNTc\"},{\"commentCreator\":\"uname250\",\"comment\":\"great!\",\"commentDate\":\"June 7, 2016 2:30 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDMwMzA\"},{\"commentCreator\":\"uname250\",\"comment\":\"let&#39;s go let&#39;s go!  Heyeeeeee!!\",\"commentDate\":\"June 7, 2016 2:28 PM\",\"commentId\":\"dW5hbWUyNTAyMDE2NTcxNDI4OA=\"}]', '4', 'Ben Carson', '2016-01-26 14:40:00', '2013-10-29 00:00:00', '4', 'Ben Carson', 'Interview', 'http://www.washingtontimes.com/news/2013/oct/29/carson-stop-feeding-the-beast/?page=2', 'Washington Post', '1', '0', '1'),
	(23, ' \"I think really the things you do in your house, we could just leave those in your house and they wouldn''t have to be part of the workplace,\".<br/></br> \"I think society is rapidly changing and if you are gay, there are plenty of places that will hire you.\"', '', '7', 'Rand Paul', '2015-10-14 00:00:00', '2015-10-14 00:00:00', '7', 'Rand Paul', 'Lecture', 'http://www.huffingtonpost.com/entry/rand-paul-lgbt-workers_us_561ed745e4b028dd7ea691a5', 'Drake University', '0', '0', ''),
	(24, '\"I’m proud to support Israel, America’s longtime friend and ally in the Middle East. \r\n<br/><br/>\r\nIsraeli cafés and buses are bombed, towns are victimized by hundreds of rockets, and its citizens are attacked by Palestinian terrorists.\r\n<br/><br/>\r\nIt’s time we took a stand for Israel by standing up to the enemies of Israel, the enemies that murder Israeli citizens.\"', '', '7', 'Rand Paul', '2015-10-14 00:00:00', '2015-10-14 00:00:00', '7', 'Rand Paul', 'Interview', 'https://www.randpaul.com/issue/israel', 'Website', '0', '0', '0'),
	(25, '\"As a physician, one of the first things we learn is to ‘Do no harm.’  Since Roe v. Wade decision, over 50 million children have been killed in abortion procedures. As President, I would strongly support legislation restricting federal courts from hearing cases like Roe v. Wade, in an effort to stop harming the lives of the unborn.\"', '', '7', 'Rand Paul', '2016-01-26 00:00:00', '2016-01-26 00:00:00', '7', 'Rand Paul', 'Website', 'https://www.randpaul.com/issue/sanctity-of-life', 'Interview', '0', '0', '0'),
	(26, '\"We must pursue policies to transform this country into a nation that affirms the value of its people of color. That starts with addressing the five central types of violence waged against black, brown and indigenous Americans: physical, political, legal, economic and environmental.\"', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/racial-justice/', 'Interview', '0', '0', '0'),
	(27, '\"The United States has made remarkable progress on gay rights in a relatively short amount of time. But there is still much work to be done.\n<br/><br/>\nIn many states, it is still legal to fire someone for being gay. It is legal to deny someone housing for being transgender. That is unacceptable and must change. We must end discrimination in all forms.\"', '[{\"commentCreator\":\"uname302\",\"comment\":\"How now brown cow?\",\"commentDate\":\"August 18, 2016 9:13 AM\",\"commentId\":\"dW5hbWUzMDIyMDE2NzE4OTEzMjc\"},{\"commentCreator\":\"uname221\",\"comment\":\"...that Gulf stream waterrrr. This land was made for you and mee!.\",\"commentDate\":\"March 2, 2016 6:44 PM\",\"commentId\":\"pejatHewe632\"}]', '5', 'Bernie Sanders', '2016-08-18 09:13:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/fighting-for-lgbt-equality/', 'Interview', '0', '0', '2'),
	(28, '\"This is not a radical idea. Last year, Germany eliminated tuition because they believed that charging students $1,300 per year was discouraging Germans from going to college. Next year, Chile will do the same. Finland, Norway, Sweden and many other countries around the world also offer free college to all of their citizens. If other countries can take this action, so can the United States of America.\"', '', '5', 'Bernie Sanders', '2016-01-28 00:00:00', '2016-01-28 00:00:00', '5', 'Bernie Sanders', 'Website', 'https://berniesanders.com/issues/its-time-to-make-college-tuition-free-and-debt-free/', 'Interview', '0', '0', '0'),
	(29, '\"First we have to remember what the engine of economic growth is in this nation? Small businesses, family-owned businesses, community-based businesses. Two-thirds of new jobs are created by small businesses. Half of Americans are employed by small businesses. We''re crushing them. We''re now destroying more than we''re creating. That''s why we have to roll back this regulatory burden and take a 75,000-page tax code and make it three pages, because guess what? When you have a big costly, complicated government, only the big, the powerful, wealthy and well connected can deal with it. It''s called crony capitalism. It''s why we must reduce the size of government.\"', '', '6', 'Carly Fiorina', '2015-08-09 00:00:00', '2015-08-09 00:00:00', '6', 'Carly Fiorina', 'Interview', 'http://ontheissues.org/2016/Carly_Fiorina_Budget_+_Economy.htm', 'Fox News Sunday interviews', '0', '0', ''),
	(30, '\"We have loads of laws, and most of the time, criminals are breaking those laws and we are curtailing citizens'' lawful rights to carry guns,\" she said. \"The assault weapons ban is extremely arbitrary about what qualifies as an assault weapon.\"', '', '6', 'Carly Fiorina', '2010-09-02 00:00:00', '2010-09-02 00:00:00', '6', 'Carly Fiorina', 'Quote', 'http://articles.latimes.com/2010/sep/02/local/la-me-senate-20100902/2', 'Los Angeles Times', '0', '0', '0'),
	(31, '\"I was recruited to HP to save a company. It was a company that had grown into a bloated bureaucracy that cost too much and delivered too little to customers and shareholders. As an outsider, I tackled HP''s entrenched problems head-on, I cut the bureaucracy down to size, reintroduced accountability, focused on service, on innovation, on leading in every market and every product segment. It was a difficult time. However, we saved 80,000 jobs. We went on to grow to 160,000 jobs. I had to make tough calls in tough times. I think people are looking for that in Washington. I was fired over a disagreement in the boardroom. One of the things that people don''t understand is how accountable a CEO is. I had to report results every 90 days\"', '[{\"commentCreator\":\"uname100\",\"comment\":\"Elysium Health claims to have hit the jackpot with a pill that rejuvenates aging cells. But researchers are divided over the safest way to deliver such products to consumers.\",\"commentDate\":\"February 9, 2016 10:40 AM\",\"commentId\":\"pejatHewe632\"}]', '6', 'Carly Fiorina', '2016-02-09 10:40:00', '2015-10-29 00:00:00', '6', 'Carly Fiorina', 'Interview', 'http://www.cnbc.com/2015/10/29/cnbc-full-transcript-cnbcs-your-money-your-vote-the-republican-presidential-debate-part-2.html', 'CNBC', '0', '0', '1'),
	(32, '“I am running for one reason and one reason only: And that is to rebuild the power of the truth of the American dream you and I share; that dream that was given to us by our parents, and grandparents. Not by their words, not by their hopes, but by the actions they took in their own lives to make our country better so that their children and grandchildren could have a better future.” ', '', '8', 'Martin O''malley', '2015-09-27 00:00:00', '2015-09-27 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://www.oskaloosa.com/news/local_news/presidental-candidate-o-malley-visits-oskaloosa/article_0f4562d7-d268-54d4-8e5c-abaec683aad1.html', 'Oskaloosa Herald Online', '0', '0', '0'),
	(33, '“I think the relationship between the United States and Israel is strong, will remain strong, and must be strong for our own security, but also, we have to continue to wage peace, and in this context, waging peace means pushing for a two-state solution.”', '', '8', 'Martin O''malley', '2015-03-26 00:00:00', '2015-03-26 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://www.huffingtonpost.com/2015/03/26/martin-omalley-israel-_n_6952086.html', 'Huffington Post', '0', '0', '0'),
	(34, '“If you hate the president so much you would rather support the ayatollah of Iran, you should probably not be in the United States Senate.”', '', '8', 'Martin O''malley', '2015-03-29 00:00:00', '2015-03-29 00:00:00', '8', 'Martin O''Malley', 'Interview', 'http://thehill.com/policy/international/237319-omalley-nuclear-iran-greatest-man-made-threat', 'ABC', '0', '0', '0'),
	(35, '\"Our nation’s founding document and the supreme law of the land was crafted by our founding fathers to act as chains to bind the mischief of government and to protect the liberties endowed to us by our Creator.<br/><br/>\r\nUnfortunately, recent administrations have defied the Constitution and the rule of law, and as a result we are less free.<br/><br/>\r\nWe need to restore the Constitution as our standard. We need to protect the people by rolling back the federal government to the functions the Constitution sets out. We need to give power back to the states and the people so that we remain a land where liberty can flourish.\"', '', '14', 'Ted Cruz', '2015-10-14 00:00:00', '2015-10-14 00:00:00', '14', 'Ted Cruz', 'Website', 'https://www.tedcruz.org/issues/restore-the-constitution/', 'Website', '0', '0', '0');";


	if ($conn1->query($sql1) === TRUE) {
	    echo "<br/>Table political quotes successfully loaded";
